package While_DoWhile_loop;

public class Day08_doWhileLoop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int A = 1;
		do {
			System.out.println("Hello");
			A++;
		} while (A < 5);
		
		int B =3;
		do { 
			System.out.println("I am Aimal");
			B++;
		} while ( B < 5);
	}

}
